import React, { Component, useState, useEffect } from "react";
import Googlemap from "../component/map/maploader";
import Header from "../component/header";
import { useRouter } from "next/router";
import "../component/map/config";
import Link from "next/link";
import GooglePlacesAutocomplete, {
  geocodeByAddress,
  getLatLng,
} from "react-google-places-autocomplete";
import Componentdidmount from "../component/componentdidmount";

export default function map() {
  const router = useRouter();
  var places_data = places;
  var click;

  const [txtname, setTxtname] = React.useState("");

  const [address, setAddress] = useState(null);


  function trylang() {
    alert(click);
  }

  useEffect(() => {
    setAddress({
      value: global.config.place.deliver.pickoff,
      label: global.config.place.deliver.pickoff,
    });
    setAddressDrop({
      value: global.config.place.deliver.dropoff,
      label: global.config.place.deliver.dropoff,
    });
    return () => {
      setAddress({
        value: global.config.place.deliver.pickoff,
        label: global.config.place.deliver.pickoff,
      });
      setAddressDrop({
        value: global.config.place.deliver.dropoff,
        label: global.config.place.deliver.dropoff,
      });
    };
  }, []);

  const [addressDrop, setAddressDrop] = React.useState("");
  const [coordinates, setCoordinates] = React.useState({
    lat: null,
    lng: null,
  });
  const [coordinatesDrop, setCoordinatesDrop] = React.useState({
    lat: null,
    lng: null,
  });

  const handleChange = async (value) => {
    const results = await geocodeByAddress(value.label);
    const latLng = await getLatLng(results[0]);
    setAddress(value);
    setCoordinates(latLng);
    try {
      var objIndex = places_data.findIndex((obj) => obj.id == click);
      (places_data[objIndex].lat = latLng.lat),
        (places_data[objIndex].lng = latLng.lng),
        (places_data[objIndex].address = value.label),
        console.log(places);
      router.push("");
    } catch (err) {
      const destination = {
        address: value.label,
        lat: latLng.lat,
        lng: latLng.lng,
        id: "1",
      };
      places.push(destination);
      console.log(places);
      router.push("");
    }
  };

  const handleChangeDrop = async (value) => {
    const results = await geocodeByAddress(value.label);
    const latLng = await getLatLng(results[0]);
    setAddressDrop(value);
    setCoordinatesDrop(latLng);
    setCoordinates(latLng);
    try {
      var objIndex = places_data.findIndex((obj) => obj.id == click);
      (places_data[objIndex].lat = latLng.lat),
        (places_data[objIndex].lng = latLng.lng),
        console.log(places);
      router.push("");
    } catch (err) {
      const destination = {
        lat: latLng.lat,
        lng: latLng.lng,
        id: "2",
      };
      places.push(destination);
      router.push("");
    }
  };

  function updateInputValue(evt) {
    try {
      var objIndex = places_data.findIndex((obj) => obj.id == click);
      (places_data[objIndex].detailsname = evt.target.value),
        console.log(places);
    } catch (err) {
      console.log(err);
    }
  }

  function updateInputValueNumber(evt) {
    try {
      var objIndex = places_data.findIndex((obj) => obj.id == click);
      (places_data[objIndex].detailsnumber = evt.target.value),
        console.log(places);
    } catch (err) {
      console.log(evt.target.value);
    }
  }

  function updateInputValueAdd(evt) {
    try {
      var objIndex = places_data.findIndex((obj) => obj.id == click);
      (places_data[objIndex].detailsAdd = evt.target.value),
        console.log(places);
    } catch (err) {
      console.log(evt.target.value);
    }
  }
  return (
    <>
      <div className="container-fluid conMap">
        <Componentdidmount></Componentdidmount>
        <Header></Header>
        <div className="row">
          <div className="col-lg-6 colLeft">
            <div
              className="row align-items-center"
              style={{ padding: "40px 0px" }}
            >
              <div className="col-lg-4">
                <img src="Image/logo.png" className="img-fluid imgLogo"></img>
              </div>
              <div className="col-lg-8">
                <ul className="my-row">
                  <li>HOME</li>
                  <li>DELIVER</li>
                  <li>CONTACT</li>
                  <li>LOGIN</li>
                </ul>
              </div>
            </div>
            <p className="pPick">
              {" "}
              <img
                src="Image/mapgps.svg"
                className="img-fluid"
                style={{ marginRight: "10px" }}
              ></img>{" "}
              Pick Up Location
            </p>
            <div onClick={() => (click = 1)}>
              <div className = "form-inline">
              <GooglePlacesAutocomplete
                selectProps={{
                  value: address,
                  onChange: handleChange,
                }}
                autocompletionRequest={{
                  componentRestrictions: {
                    country: ["ph"],
                  },
                }}
              />
              <img src = "Image/google-maps.png" className = "img-fluid"></img>
              </div>
              <div class="divHide">
                <p className="pAdd">&#x2b; Add details</p>
                <div className="divAdd">
                  <div className="row">
                    <div className="col-lg-12">
                      <input
                        type="text"
                        className="txtName"
                        onChange={(evt) => updateInputValue(evt)}
                        placeholder="Name"
                      ></input>
                    </div>
                    <div className="col-lg-6">
                      <input
                        type="text"
                        className="txtNumber"
                        onChange={(evt) => updateInputValueNumber(evt)}
                        placeholder="Contact Number"
                      />
                    </div>
                    <div className="col-lg-6">
                      <input
                        type="text"
                        className="txtNumber"
                        onChange={(evt) => updateInputValueAdd(evt)}
                        placeholder="Blk/Floor/Unit"
                      />
                    </div>
                  </div>
                </div>
              </div>
            </div>
            <p className="pPick-up"></p>
            <p className="pPick" style={{ marginTop: "30px" }}>
              {" "}
              <img
                src="Image/mapgps.svg"
                className="img-fluid"
                style={{ marginRight: "15px" }}
              ></img>
              Drop Off Location
            </p>
           <div onClick={() => (click = 2)}>
           <GooglePlacesAutocomplete
              selectProps={{
                value: addressDrop,
                onChange: handleChangeDrop,
              }}
              autocompletionRequest={{
                componentRestrictions: {
                  country: ["ph"],
                },
              }}
            />
            <div class="divHide" >
              <p className="pAdd">&#x2b; Add details</p>
              <div className="divAdd">
                <div className="row">
                  <div className="col-lg-12">
                    <input
                      type="text"
                      onChange={(evt) => updateInputValue(evt)}
                      className="txtName"
                      placeholder="Name"
                    ></input>
                  </div>
                  <div className="col-lg-6">
                    <input
                      type="text"
                      className="txtNumber"
                      onChange={(evt) => updateInputValueNumber(evt)}
                      placeholder="Contact Number"
                    />
                  </div>
                  <div className="col-lg-6">
                    <input
                      type="text"
                      className="txtAdd"
                      onChange={(evt) => updateInputAdd(evt)}
                      placeholder="Blk/Floor/Unit"
                    />
                  </div>
                </div>
              </div>
            </div>
           </div>
            <p className="pNote">Note: Delivery only within Metro Manila</p>
            <div className="divCategory">
              <p className="pPick" style={{ fontSize: "1rem" }}>
                Category
              </p>
              <div className="row">
                <div className="col">
                  <div className="boxCategory align-items-center d-flex justify-content-center">
                    <div>
                      <img
                        src="Image/001-file.svg"
                        className="img-fluid mx-auto d-flex imgCategory"
                      ></img>
                      <p className="pBoxCategory">DOCUMENT</p>
                    </div>
                  </div>
                </div>
                <div className="col">
                  <div className="boxCategory align-items-center d-flex justify-content-center">
                    <div>
                      <img
                        src="Image/002-pizza.svg"
                        className="img-fluid mx-auto d-flex imgCategory"
                      ></img>
                      <p className="pBoxCategory">FOOD</p>
                    </div>
                  </div>
                </div>
                <div className="col">
                  <div className="boxCategory align-items-center d-flex justify-content-center">
                    <div>
                      <img
                        src="Image/clothing.svg"
                        className="img-fluid mx-auto d-flex imgCategory"
                      ></img>
                      <p className="pBoxCategory">CLOTHING</p>
                    </div>
                  </div>
                </div>
                <div className="col">
                  <div className="boxCategory align-items-center d-flex justify-content-center">
                    <div>
                      <img
                        src="Image/medical.svg"
                        className="img-fluid mx-auto d-flex imgCategory"
                      ></img>
                      <p className="pBoxCategory">MEDICAL</p>
                    </div>
                  </div>
                </div>
                <div className="col">
                  <div className="boxCategory align-items-center d-flex justify-content-center">
                    <div>
                      <img
                        src="Image/001-file.svg"
                        className="img-fluid mx-auto d-flex imgCategory"
                      ></img>
                      <p className="pBoxCategory">FRAGILE</p>
                    </div>
                  </div>
                </div>
                <div className="col">
                  <div className="boxCategory align-items-center d-flex justify-content-center">
                    <div>
                      <img
                        src="Image/other.svg"
                        className="img-fluid mx-auto d-flex imgCategory"
                      ></img>
                      <p className="pBoxCategory">OTHERS</p>
                    </div>
                  </div>
                </div>
                <div
                  className="col-lg-12 col-md-12 col-12"
                  style={{ display: "none" }}
                >
                  <p className="pNote">Note: MAXIMUM WEIGHT IS 10kg</p>
                </div>
              </div>
              <div className="row" style={{ marginTop: "30px" }}>
                <div className="col-lg-12">
                  <p className="pAdditional">Additional Services</p>
                </div>
                <div className="col-lg-3 p-1">
                  <div className="boxAdditional">
                    <p className="pAdditonalBox">Insulated Box</p>
                  </div>
                </div>
                <div className="col-lg-3 p-1">
                  <div className="boxAdditional">
                    <p className="pAdditonalBox">Cash Handling</p>
                  </div>
                </div>
                <div className="col-lg-3 p-1">
                  <div className="boxAdditional">
                    <p className="pAdditonalBox">Queueing Service</p>
                  </div>
                </div>
                <div className="col-lg-3 p-1">
                  <div className="boxAdditional">
                    <p className="pAdditonalBox">Pabili Service</p>
                  </div>
                </div>
              </div>
              <div
                className="row"
                style={{ marginTop: "25px", padding: "0px" }}
              >
                <div className="col-lg-6" style={{ paddingLeft: "0px;" }}>
                  <div className="form-inline">
                    <img
                      src="Image/mastercard.svg"
                      className="img-fluid"
                      style={{ width: "50px" }}
                    ></img>
                    <p
                      className="pCardNumber"
                      data-toggle="modal"
                      data-target="#exampleModalCenter"
                    >
                      Mastercard 8278
                    </p>
                  </div>
                </div>
                <div className="col-lg-6">
                  <img
                    src="Image/instant.svg"
                    className="img-fluid imgInstant"
                  ></img>
                </div>
                <div className="col-lg-12">
                  <Link href="">
                    <p className="pNext" onClick = {trylang}>Next >></p>
                  </Link>
                </div>
              </div>
            </div>
          </div>
          <div className="col-lg-6 colMap">
            <div className="divMap fixed-top">
              <Googlemap></Googlemap>
            </div>
          </div>
        </div>
      </div>
      <div
        className="modal fade"
        id="exampleModalCenter"
        tabIndex={-1}
        role="dialog"
        aria-labelledby="exampleModalCenterTitle"
        aria-hidden="true"
      >
        <div className="modal-dialog modal-dialog-centered" role="document">
          <div className="modal-content">
            <div className="modal-header">
              <h5 className="modal-title" id="exampleModalLongTitle">
                Mode of Payment
              </h5>
            </div>
            <div className="modal-body">
              <div className="form-inline formCard">
                <img
                  src="Image/mastercard.svg"
                  className="img-fluid"
                  style={{ width: "35px" }}
                ></img>
                <p
                  className="pCardNumberModal"
                  data-toggle="modal"
                  data-target="#exampleModalCenter"
                >
                  Mastercard 8278
                </p>
              </div>
              <div className="form-inline formCard">
                <img
                  src="Image/visa.png"
                  className="img-fluid"
                  style={{ width: "35px" }}
                ></img>
                <p
                  className="pCardNumberModal"
                  data-toggle="modal"
                  data-target="#exampleModalCenter"
                >
                  Visa 8278
                </p>
              </div>
              <div className="form-inline formCard">
                <img
                  src="Image/cash.png"
                  className="img-fluid"
                  style={{ width: "35px" }}
                ></img>
                <p
                  className="pCardNumberModal"
                  data-toggle="modal"
                  data-target="#exampleModalCenter"
                >
                  Cash on delivery
                </p>
              </div>
            </div>
            <div className="modal-footer">
              <div className="row align-items-center">
                <div className="col-lg-6">
                  <img src="Image/instant.svg" className="img-fluid" />
                </div>
                <div className="col-lg-6">
                  <button className="btnBookModal">BOOK</button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
